import NavBar from "./component/NavBar/NavBar";
import Header from "./component/Header/Header";
import Content from "./component/Content/Content";
import Footer from "./component/Footer/Footer";
import { useEffect, useState } from "react";


const Home = ({ isLogin, email }) =>
{
  const [dataHotels, setDataHotels] = useState()

  const fetchHotels = async () =>
  {
    const request = await fetch('http://localhost:5000/hotel')
    const dataHotels = await request.json()
    setDataHotels(dataHotels)

  }
  useEffect(() =>
  {
    fetchHotels()

  }, [])
  return (
    <div>
      <NavBar isLogin={isLogin} email={email}></NavBar>
      <Header></Header>
      <Content data={dataHotels}></Content>
      <Footer></Footer>
    </div>
  );
};

export default Home;
